trailingComments.value:
    var tip = d3.tip()
			.attr('class', 'd3-tip')
			.offset([140, 0])
			.html(function(d) {
				var text = "<p><strong>ID:</strong> <span>" + d.ID + "</span></p>";
				text += "<p><strong>pos:</strong> <span>" + d.placement + "</span></p>";
				return text;
			})

